import request from '@/utils/request'; //评价计划查询

export function queryRecord(query) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan",
    method: 'get',
    params: query
  });
} //评价计划（新增）

export function addRecord(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan",
    method: 'post',
    data: data
  });
} //评价计划（编辑）

export function updateRecord(rowId, data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan/".concat(rowId),
    method: 'patch',
    data: data
  });
} //评价计划删除

export function deleteRecord(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan/delete",
    method: 'delete',
    data: data
  });
} //评价计划（提交）

export function submitRecord(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan/commit",
    method: 'patch',
    data: data
  });
}
